var title_f33_20_34121="Simple endometrial hyperplasia";
var content_f33_20_34121=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F73789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F73789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Simple endometrial hyperplasia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 375px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The endometrial glands in this lesion are irregularly distributed but widely separated by stroma, which is also hyperplastic. The glands are mostly round or tubular, with only a few angularities encountered.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Silverberg SG, Kurman,RJ. Tumors of the Uterine Corpus and Gestational Trophoblastic Disease. AFIP Atlas of Tumor Pathology, version 2.0, American Registry of Pathology, Washington DC 1995.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
