"   <div class=\"ttl\">",
"    Survival after bone marrow transplantation or immunosuppressive therapy in aplastic anemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 428px; height: 294px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Actuarial survival after therapy for aquired aplastic anemia comparing 168 patients who underwent bone marrow transplantation (BMT) to 227 patients who received immunosuppressive therapy. Survival was significantly improved in the patients receiving a transplant (p&lt;0.001; log-rank test).",
"    <div class=\"footnotes\">",
"    </div>",
